import React from 'react';
function Resource(props)	
	{
	return(
		<div>
		{props.name}  {props.amount>0? props.amount : "0"}
		<br />
		MAX: {props.resouceMax}<br />
		time until max: {props.counterTillStopped}<br />
		rate of increase: {props.changePerTick}

		</div>


		)
}

export default Resource;
